import "./Banner1.css";

export default function Banner1() {
  return (
    <div>
        <div className='banner1-div'>
            <div className='first-banner banner col-lg-6 col-12'>
                <h2>Sale 20% Off</h2>
                <p className='p1'>Satechi Aluminum Multi-Port Adapter<br></br>4K HDMI (30Hz)</p>
                <p>New arrivals in Accessories at best prices</p>
            </div>
            <div className='second-banner banner col-lg-6 col-12'>
                <h2>New Arrivals</h2>
                <p className='p1'>Great Performance Costs Less<br></br>Thank You Think</p>
                <p>Saving 30% Off on all online store items</p>
            </div>
        </div>
    </div>
  )
}
